@import "./media-queries.scss";

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: "Roboto", sans-serif;
}

html, body {
    background-color: rgb(0, 0, 0);
    overflow: hidden;
}

canvas {
    position: fixed;
    top: 0;
    left: 0;
    outline: none;
}

a {
    text-decoration: none;
}

h1, h2, h3, p, span, a {
    color: #fff;
}

p {
    font-family: 'Roboto', sans-serif;
}

footer {
    position: absolute;
    width: 100%;
    height: 50px;
    bottom: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    
    a {
        text-decoration: underline;
        margin: 0 10px;
        cursor: pointer;
        z-index: 10;
    }
}

.loader {
    position: fixed;
    top: 50%;
    left: 50%;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    transform: translate(-50%, -50%);
    z-index: 10000;
    background-color: rgb(4, 19, 1);

    p {
        font-size: 75px;
    }

    button {
        display: none;
        position: absolute;
        top: 50%;
        left: 50%;
        width: 75px;
        height: 75px;
        background: transparent;
        border: 1px solid #fff;
        border-radius: 50%;
        font-weight: bold;
        color: #fff;
        transition: 0.3s;
        transform: translate(-50%, -50%);
        opacity: 0;
        cursor: pointer;

        &:hover {
            transform: translate(-50%, -50%) scale(1.1);
        }
    }
}

